query:
(
    /* Meraki Scanning API v3 Clients with AP Details */

    /* -- Shortcut vars -- */
    $aps := $.`data`.`reportingAps`;
    $clients := $.`data`.`observations`;

    /* Finds location history, defaults to last AP's location */
    $getLocations := function($c){
        $c.locations ? $c.locations^(>time).{
            "lat":lat,
            "lng":lng,
            "time":time
        } : $findApDetails($c.latestRecord.nearestApMac).[{
            "lat":lat,
            "lng":lng
        }]
    };

     /* -- Google Static map Functions -- */

    /*
        $gMapExampleString := "<img src='https://maps.googleapis.com/maps/api/staticmap?center=Brooklyn+Bridge,New+York,NY&zoom=13&size=600x300&maptype=roadmap&markers=color:blue%7Clabel:S%7C40.702147,-74.015794&markers=color:green%7Clabel:G%7C40.711614,-74.012318&markers=color:red%7Clabel:C%7C40.718217,-73.998284&key=AIzaSyC44dPQFhdDKl2FP5debdlS9Po0X-OmALc'>";
    */

    $gMapKey := "key=AIzaSyC44dPQFhdDKl2FP5debdlS9Po0X-OmALc";
    $gMapBase := "https://maps.googleapis.com/maps/api/staticmap?maptype=roadmap&zoom=21&size=400x300&style=visibility:on" & "&" & $gMapKey;

    $getMapCenter := function($lat,$lng){"center=" & $lat & $lng};
    $getPathMarkers := function($locations){
        (
         $markers := $locations.(lat & "," & lng);
        "path=color:0x0000ff|weight:5|" & $join($markers, "|")
        )
    };
    $getMapMarkers := function($locations){
        "markers=color:blue|" & $locations[0].lat & "," & $locations[0].lng
    };

    /* Build Google Map URL String */
    $getMapUrl := function($locations){
        (
            $gMapBase & "&" & $getMapCenter($locations[0].lat,$locations[0].lng) & "&" &  $getPathMarkers($locations) & "&" & $getMapMarkers($locations)
        )
    };


    /* -- Scanning API Helper Functions -- */
    /* Find an AP by MAC */
    $findApDetails := function($apMac){
                        $filter($aps, function($v) {
                            $v.mac = $apMac
                        }
                    )};

    /* -- Final Results -- */
    {
        "networkId":$.data.networkId,
        "startTime": $.data.startTime,
        "endTime":$.data.endTime,
        "stats": {
            "clientCount":$count($clients),
            "apCount":$count($aps)
        },
        /* for each client build payload, sorted by clientMac */
        "clients": $clients@$c^(clientMac).{

        "clientMac":$c.clientMac,
        "name":$c.name,
        "bleBeacons":$c.bleBeacons,
        "map": "<img src='" & $getMapUrl($getLocations($c)) & "' >",
        "mapLink":"<a href='http://maps.google.com/maps?z=25&t=m&q=loc:" & $getLocations($c)[0].lat & "+" & $getLocations($c)[0].lng & "' target='_blank'>Map</a>",
        /* use known locations first then default to APs location sort by time */
        "locations":$getLocations($c),

        "lastRecord": $c.latestRecord.time,
        "apDetails": $findApDetails($c.latestRecord.nearestApMac)
        }
    };

)
